import React from "react";

function Song({ song, onDeleteSong }) {
  const handleDelete = () => {
    onDeleteSong(song.artistName, song.albumTitle, song.title);
  };

  return (
    <li className="list-item">
      <span>{song.title}</span>
      <button onClick={handleDelete} className="delete-button">
        Delete
      </button>
    </li>
  );
}

export default Song;
